            var smsProvider = $(""#select-sms-provider"").children(""option:selected"").data(""provider"");

            if (smsProvider == ""jawaly"") {
                $(""label[for='UserNameSms']"").text(""اسم المستخدم للرسائل (UserNameSms)"");
