            }

            else if (smsProvider == ""ElYamam"") {
                $(""label[for='UserNameSms']"").text(""اسم المستخدم للرسائل (UserNameSms)"");
                $("".common"").show();

                $("".btn-submit"").show().css('display', 'block');

                $("".different"").hide();
            }

        }



        $(""#select-sms-provider"").change(changeSmsProvider);

